    latitude: {
        type: Sequelize.INTEGER,
        primaryKey: true,
    },
    longitude: {
        type: Sequelize.INTEGER,
        primaryKey: true,
    },

    address: {
        type: Sequelize.TEXT
    }

}, {
    timestamps: false
});

//console.log('p', Place);
export default Place;

